    public static class Deneme
    {
        public static void CreateRandomDataGPT(this ModelBuilder modelBuilder)
        {
            var categories = CreateRandomDataBuilderExtensionGPT.GenerateCategories(10);
            var products = CreateRandomDataBuilderExtensionGPT.GenerateProducts(50, categories);
            var sliders = CreateRandomDataBuilderExtensionGPT.CreateSliders();
            modelBuilder.Entity<Category>().HasData(categories);
            modelBuilder.Entity<Product>().HasData(products);
            modelBuilder.Entity<Slider>().HasData(sliders);
        }
        public static void CreateRandomData(this ModelBuilder modelBuilder)
        {
