        public static class CreateCategoryDatas
        {
            public static List<Category> CreateRandomCategoryData()
            {
                var categoryCount = 8;
                var categoryFaker = new Faker<Category>()
                .RuleFor(c => c.CategoryName, f => f.Commerce.Categories(1)[0])
                .RuleFor(c => c.Image, f => f.Image.PicsumUrl())
                .RuleFor(c => c.Order, f => f.Random.Number(1, categoryCount))
                .RuleFor(c => c.IsActive, f => f.Random.Bool())
                .RuleFor(c => c.CreatedDate, f => f.Date.Past(2));

                return categoryFaker.Generate(categoryCount);
            }
        }
        public static class CreateProductDatas
        {
            public static List<Product> CreateRandomProductData(List<Category> categories)
            {
                var productCount = 100;
                var productFaker = new Faker<Product>()
                    .RuleFor(p => p.ProductName, f => f.Commerce.ProductName())
                    .RuleFor(p => p.Price, (f, p) => f.Finance.Amount())
                    .RuleFor(p => p.SalePrice, (f, p) => (decimal?)f.Finance.Amount())
                    .RuleFor(p => p.Stock, f => f.Random.Number(1, 100))
                    .RuleFor(p => p.Description, f => f.Lorem.Paragraph())
                    .RuleFor(p => p.Detail, f => f.Lorem.Paragraphs(2))
                    .RuleFor(p => p.Information, f => f.Lorem.Paragraphs(3))
                    .RuleFor(p => p.Size, f => f.PickRandom<Size>())
